import React, {useState} from 'react'
import Style from "./home.module.css";
import HomeCard from '../../components/homeCards/HomeCard';
import 'date-fns';
import DateFnsUtils from '@date-io/date-fns';
import {MuiPickersUtilsProvider, KeyboardDatePicker } from '@material-ui/pickers';




function Home() {
   const [selectedDate, setSelectedDate] = useState(new Date());

   let todos=[
      { 
         name:"Imran Sharif",
         email:"imran@gmail.com",
         register_no:"C-19001",
         vehicle_model:"C-19001",
         time:"09:30Am to 10:00Am",
         phone:'+97 123 4567'

      },
      { 
         name:"Hassan Saleen",
         email:"imran@gmail.com",
         register_no:"C-19001",
         vehicle_model:"C-19001",
         time:"09:30Am to 10:00Am",
         phone:'+97 123 4567'

      },
      { 
         name:"Imran Sharif",
         email:"imran@gmail.com",
         register_no:"C-19001",
         vehicle_model:"C-19001",
         time:"09:30Am to 10:00Am",
         phone:'+97 123 4567'

      },
]

  const handleDateChange = (date) => {
    console.log(date);
    setSelectedDate(date);
  };
   return (
      <>
         <div className="topHeading">
            <div className={`d-flex justify-content-between align-items-center`}>
               <div>Home</div>
               <MuiPickersUtilsProvider utils={DateFnsUtils}>
                  <KeyboardDatePicker
                     value={selectedDate}
                     onChange={handleDateChange}
                  />
               </MuiPickersUtilsProvider>
            </div>
         </div>
         <div className={Style.homeSticky}>
            <div className={Style.homeStickyWrapper}>
               <div className={Style.leftText}>Q<sub>1</sub></div>
               <div className={Style.rightText}>Car wash</div>
            </div>
         </div>
         {todos.map(function(object, i){
        return <HomeCard obj={object} key={i} />;
})}            
      </>
   )
}

export default Home
